import React from 'react';
import './App.css';
import AddUrl from './components/AddUrl'
//import UrlList from './components/UrlList'
import Header from './components/Header'


function App() {
  const random = () => {
    const randomColor = ["lightblue", "black", "lightpurple"];
    let style = randomColor[Math.floor(Math.random() * randomColor.length)];
    style = randomColor[Math.floor(Math.random() * randomColor.length)];
    return style
  }
  return (
    <div className="App">
      <Header />
      <AddUrl color={random()} />
      {/* <UrlList /> */}
    </div>
  );
}

export default App;
